import axios from 'axios';
import _ from 'underscore';

export default {
    methods: {
        showBills(keywordString) {
            axios
                .get(
                    'https://api.legiscan.com/?key=${api_key}&op=search&state=${state}&query=${keyword}',
                    {
                        params: {
                            key: '421f15e8b661176e9001a7e17a50f37b',
                            op: 'search',
                            state: 'ri',
                            query: keywordString.split().join(','),
                        },
                    }
                )
                .then((response) => {
                    var bills2 = [];
                    response = response.data.searchresult;
                    delete response.summary;
                    _.each(response, function (value) {
                        bills2.push(value);
                    });
                    console.log(bills2);
                    return bills2;
                })
                .catch(() => {
                    this.bills2 = [];
                });
        },
    },
};
